import React, { forwardRef } from "react";

const About = forwardRef(({ id }, ref) => {
  return (
    <div id={id} ref={ref}>
      未知就像一種引力
      <br />
      即使啟航於茫茫
      <br />
      始終能找到大陸和島嶼
      <br />
      等著我探險和創造
    </div>
  );
});

export default About;
